function getOutput(){var b="Done";var e=$(".list .list-header-name:contains("+b+")").parent().parent();var a=e.children(".list-cards").children(".list-card");var f="https://trello.com";var c=[];for(var d=0;d<a.length;d++){var g=$(a[d]).find(".list-card-title").attr("href");var h=$(a[d]).find(".list-card-title").text();var j=$(a[d]).find(".list-card-title span").text();h=h.replace(j,"");if(h!="Sol Integration progress report"){c.push("- "+h+" ([Trello|"+f+g+"])")}}return c.join("<br>")};